import React from 'react';


function Home() {
  return (
<section className="home" id="home">

<h3>HI THERE !</h3>
<h1>I'M <span>Aaron Wiebe</span></h1>
<p>A business analyst who analyzes and documents the market environment, processes, or systems 
  of businesses. I help businesses improve their processes, products, services, and software 
  through data analysis and software development. Experienced Software Engineer with a 
  demonstrated history of working in the aerospace, facility management, and construction 
  industries. Skilled in HTML/CSS/JavaScript, Visual Studio C++ and C#, Borland Delphi, 
  AutoCAD, LISP. Strong engineering professional with experience in developement, troubleshooting, and testing.
</p>
<a href="#about"><button className="btn">about me <i className="fas fa-user"></i></button></a>

</section>
  );
}

export default Home;
